 import './logo.css'
 import React from 'react'
 import {BrowserRouter, Routes, Route, Link} from 'react-router-dom';
 import CreateUser from './CreateUser';
 import Updates from './Updates';
 import Footer from './comp/footer';
 import Details from './Details'; 

 ////css import


import EditUser from './EditUser';
import Update from './update';

function Logo(){
    return(
        <>
        <div className='head'>
            <BrowserRouter>
            {/* code test */}
            
        <div className='logo'>
        <span className="a1">RESULT</span> <span className="a2">PAHLE</span><br />
        <span className='des'>www.resultpahle.com</span>
    </div>
    
            {/* *************end code************ */}
            <div className='nav'>
          
        
            <li ><Link className='link' to="/">Home</Link></li>
            <li ><Link className='link' to="/user/create">Result</Link></li>
            <li ><Link className='link' to="/">Search</Link></li>
            </div>
        
    
    
    {/* <div className='nav'>
        <li><Link className='link' to="/">Home</Link></li>
        <li><Link className='link' to="/user/create">Result</Link></li>
        <li><Link className='link' to="/">Search</Link></li>
    </div> */}
    <Routes>
      
          <Route index element={<Update />} />
          <Route path="user/create" element={<CreateUser />} />
          <Route path="user/:id/edit" element={<EditUser />} />
          <Route path="user/list" element={<Updates/>} />
          <Route path="user/:id/edit" element={<Details/>} />
        </Routes>
        </BrowserRouter>
       
</div>
 <div className='footer'>
 <Footer/>
 </div>
 </>
)}
export default Logo
